import React from 'react'
import { Link } from "react-router-dom";
import logo from './../../assets/img/logos/logo-white-small.png'


const NavbarSide = () => {
    return (
        <Nav>
            <NavLink to="/homepage">
                <img style={{'marginBottom':'11px'}} src={logo}></img>
            </NavLink>
        </Nav>
    )
}

export default NavbarSide
